def project = testRunner.testCase.testSuite.project

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def propFileName = context.expand('${projectDir}') + groovyUtils.expand('${#Project#PROPS_FILE}')

Properties extraProps

try 
{	
	log.info "absolute path for properties file:" + propFileName	

	if (!propFileName)
	{
		throw new IllegalArgumentException("Property 'propFileName' not set!")
	}

	FileInputStream propFileInput = new FileInputStream(propFileName)
	loadedProps = new Properties()
	loadedProps.load(propFileInput)
	log.info "Loaded properties from File: $loadedProps"

	def projectProperties = project.properties

	//CLEAN
	for(p in projectProperties)
	{
		if(!p.key.contains("PROPS"))
		{
			project.setPropertyValue(p.key, "");
		}
	}	

	for(p in projectProperties)
	{
		log.info p.key + " : " + loadedProps[p.key];		

		if(p.key.equals("PSSP_CLIENT_ID") && (loadedProps[p.key].trim().equals("null") || loadedProps[p.key].trim().equals("")))
		{
			com.eviware.soapui.support.UISupport.showInfoMessage('PSSP_CLIENT_ID not configured in properties file. Contact NMS team if it is not known how to edit this file. ')			
			//testRunner.cancel("erfsrf")
			testRunner.fail("Configuration error.")
			throw new Exception("PSSP_CLIENT_ID not configured in properties file.")		
		}

		if(!p.key.contains("PROPS"))
		{
			project.setPropertyValue(p.key, loadedProps[p.key]);
		}
	}
} 
catch (e) 
{
	log.warn "Error: $e"
}

project.setPropertyValue("ACTIVE_IN", "OCS" )

